import React, { useState } from 'react';
import {
  Container,
  Typography,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField
} from '@material-ui/core';
import { Add, Edit, Delete } from '@material-ui/icons';

const ProductManagement = () => {
  const [products, setProducts] = useState([
    { id: 1, name: 'Burger', price: 5.99 },
    { id: 2, name: 'Pizza', price: 8.99 },
    { id: 3, name: 'Sandwich', price: 4.99 },
  ]);

  const [open, setOpen] = useState(false);
  const [editProduct, setEditProduct] = useState(null);
  const [formData, setFormData] = useState({ name: '', price: '' });

  const handleOpen = (product = null) => {
    if (product) {
      setEditProduct(product);
      setFormData({ name: product.name, price: product.price });
    } else {
      setEditProduct(null);
      setFormData({ name: '', price: '' });
    }
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
    setEditProduct(null);
    setFormData({ name: '', price: '' });
  };

  const handleSubmit = () => {
    if (editProduct) {
      setProducts(products.map(p => 
        p.id === editProduct.id 
          ? { ...p, name: formData.name, price: parseFloat(formData.price) }
          : p
      ));
    } else {
      const newProduct = {
        id: Date.now(),
        name: formData.name,
        price: parseFloat(formData.price)
      };
      setProducts([...products, newProduct]);
    }
    handleClose();
  };

  const handleDelete = (id) => {
    setProducts(products.filter(p => p.id !== id));
  };

  return (
    <Container>
      <Typography variant="h4" style={{ margin: '20px 0' }}>
        Manage Menu Items
      </Typography>

      <Button
        variant="contained"
        color="primary"
        startIcon={<Add />}
        onClick={() => handleOpen()}
        style={{ marginBottom: '20px' }}
      >
        Add New Item
      </Button>

      <List>
        {products.map((product) => (
          <ListItem key={product.id}>
            <ListItemText
              primary={product.name}
              secondary={`$${product.price.toFixed(2)}`}
            />
            <ListItemSecondaryAction>
              <IconButton edge="end" onClick={() => handleOpen(product)} style={{ marginRight: '8px' }}>
                <Edit />
              </IconButton>
              <IconButton edge="end" onClick={() => handleDelete(product.id)}>
                <Delete />
              </IconButton>
            </ListItemSecondaryAction>
          </ListItem>
        ))}
      </List>

      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{editProduct ? 'Edit Item' : 'Add New Item'}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Item Name"
            fullWidth
            value={formData.name}
            onChange={(e) => setFormData({ ...formData, name: e.target.value })}
          />
          <TextField
            margin="dense"
            label="Price"
            type="number"
            fullWidth
            value={formData.price}
            onChange={(e) => setFormData({ ...formData, price: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleSubmit} color="primary">
            {editProduct ? 'Save' : 'Add'}
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default ProductManagement;
